description:
All in One SEO Pack Pro v2.0 improves on the most popular WordPress SEO plugin.  With All in One SEO Pack Pro you can set site-wide defaults in WordPress as well as customize the search engine settings for each individual WordPress post and page.  All in One SEO Pack Pro gives you complete control over exactly what appears in the search engine results.

All in One SEO Pack Pro is easy to use right out of the box, so you can start improving your search engine results right away!
